import { name as typeName } from "../types/custom";
export function register(serializer) {
    function write(type, value) {
        return type.write(value, serializer);
    }
    function read(type, input) {
        return type.read(input, serializer);
    }
    function readTrusted(type, input) {
        return type.read(input, serializer);
    }
    serializer.register({
        typeName,
        write,
        read,
        readTrusted,
    });
}
